css:
.theme-atom-material-ui .go-plus-panel .panel-heading {
  font-size: 0.8rem;
  font-weight: normal;
  margin-bottom: 0;
}
.theme-atom-material-ui .go-plus-panel .panel-icon-button {
  width: 2.25rem;
  text-align: center;
}
.theme-atom-material-ui .go-plus-panel .panel-icon-button .etch-octicon {
  margin-right: 0;
}
.theme-atom-material-ui .go-plus-panel .panel-nav-item {
  border: none;
  border-right: 0.125rem solid transparent;
}
.theme-atom-material-ui .go-plus-panel .panel-nav-item.is-selected {
  border-color: currentColor;
}
.theme-atom-material-ui .go-plus-panel.is-vertical .panel-nav-item {
  border-bottom: none;
  border-right: 0.125rem solid transparent;
}
.theme-atom-material-ui .go-plus-panel.is-vertical .panel-nav-item.is-selected {
  border-color: currentColor;
}
